test('text-wrap', async () => {
  expect(await run(['text-wrap', 'text-nowrap', 'text-balance', 'text-pretty']))
    .toMatchInlineSnapshot(`
      ".text-balance {
        text-wrap: balance;
      }

      .text-nowrap {
        text-wrap: nowrap;
      }

      .text-pretty {
        text-wrap: pretty;
      }

      .text-wrap {
        text-wrap: wrap;
      }"
    `)
  expect(
    await run([
      '-text-wrap',
      '-text-nowrap',
      '-text-balance',
      '-text-pretty',
      'text-wrap/foo',
      'text-nowrap/foo',
      'text-balance/foo',
      'text-pretty/foo',
    ]),
  ).toEqual('')
})
